    <>
      <div className="card-body" style={{ flex: 1 }}>
        <Bar
          data={{
            labels: ["a", "b", "c"],
            datasets: {
              labels: ["Mychart"],
              data: [100, 200, 300],
            },
          }}
        />
      </div>
    </>
  );
}
